import React from 'react';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

export default function CheckoutSteps(props) {
    return <Row className='checkout-steps'>
        <Col className={props.stap1 ? 'active' : ''}>Sign-In</Col>
        <Col className={props.stap2 ? 'active' : ''}>Shipping</Col>
        <Col className={props.stap3 ? 'active' : ''}>Payment</Col>
        <Col className={props.stap4 ? 'active' : ''}>Place Order</Col>
    </Row>;
}
